import Counter from "./Components/Counter";
import FetchDelete from "./Components/FetchDelete";
import Filter from "./Components/Filter";
import Quotes from "./Components/Quotes";
import "./index.css";

function App() {
  return (
    <div className="font-mono flex flex-wrap flex-col h-screen bg-gray-100">
      <div className="flex flex-none h-72 w-screen justify-evenly items-center ">
        <FetchDelete></FetchDelete>

        <Filter></Filter>

        <Counter></Counter>
      </div>
      <div className="flex flex-row flex-1 bg-gray-500">
        <Quotes></Quotes>
      </div>
    </div>
  );
}

export default App;
